Eğer bütün tablo yedeklenmeyecek ise ; 1.adımda Sp oluşturulacak : içinde s3e yazılacak tabloyu yeni bir tablo oluşturup insert sql'i yazılacak (tablo insertden önce truncate olacak mı karar verilmeli)

```
DECLARE @FileName2 NVARCHAR(100) = 'I:\boyner\outputreport\UnlimitedStock_' + CONVERT(VARCHAR(8),GETDATE(),112) + '.csv'
	Select @FileName2 --ilk iki satırı çalıştırıp dosya konumu ve dosya adı doğru mu test et
	EXEC [dbo].[ExportFileFromTable]
	@DbName = 'BoynerReporting',
	@SchemaName = 'report',
	@TableName = 'UnlimitedStock',
	@FilePathWithName = @FileName2,
	@Delimeter = ';'

```

2.adımda yukarıdaki alanlar doldurulacak
son 5 satıra tablonun uzantısı girilecek
filename rdp'de dosyanın nereye ekleneceği girilecek
yukarıdaki örnek : boynerreporting.report.unlimitedstock tablosunu db'de I>boyner>outputreport klasörüne ekle
